import { Dropdown } from 'react-bootstrap';
import Layout from '../Components/layout';
import {Button} from 'react-bootstrap';






const About = ()=> (
    <Layout>
   
    <div>
       
       <h2> You can use the below filters </h2>
    
    <Button style={{margin:'10px'}} >Only Successful Launch</Button>
    <Button>2012</Button>
    <Dropdown>Successful Launch or not</Dropdown>
    
    </div>
  
    </Layout>
);

export default About;
